import { Component } from "react";
import React from "react";
import Table from 'react-bootstrap/Table';
import 'bootstrap/dist/css/bootstrap.min.css'
import DataTable from "react-data-table-component";

class PatientsTable extends Component {

    constructor(props) {
        super(props);
        this.state = {
            patientData: [],
        };
    }

    componentDidMount() {
        fetch('/api/v1/patients', {
            method: 'GET',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            },
        })
            .then(res => res.json())
            .then(
                (result) => {
                    let jsObj = result;

                    this.setState({ patientData: result})

                    /*
                    for (let step = 0; step < jsObj.length; step++){
                        this.state.patientData.push(jsObj[step])
                    }*/

                    //this.state.patientData = jsObj;
                    console.log(this.state.patientData)
                },
                (error) => {
                    console.log(error)
                }
            )
    }

    render() {
        return (
            <div>
                <DataTable title="Patient Table" columns={columns} data={this.state.patientData}></DataTable>
            </div>
        )
    }

}
const columns = [
    {
        name: 'Name',
        selector: 'name',
        sortable: true,
    },
    {
        name: 'Age',
        selector: 'age',
        sortable: true,
        right: true,
    },
    {
        name: 'Symptoms',
        selector: 'symptoms',
        sortable: true,
        right: true,
    },
    {
        name: 'Room Number',
        selector: 'room_number',
        sortable: true,
        right: true,
    },
    {
        name: 'Comments',
        selector: 'comments',
        sortable: true,
        right: true,
    },
];


export default PatientsTable;
